import React, { useState } from "react";

const STAFF = ["Ravi", "Anita", "Karthik", "Priya"];
const DAYS = ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"];

export default function RosterManagement() {
  const [roster, setRoster] = useState([
    {
      id: 1,
      staff: "Ravi",
      day: "Monday",
      start: "10:00",
      end: "18:00"
    },
    {
      id: 2,
      staff: "Anita",
      day: "Tuesday",
      start: "12:00",
      end: "20:00"
    }
  ]);

  const [newShift, setNewShift] = useState({
    staff: "",
    day: "",
    start: "",
    end: ""
  });

  const addShift = () => {
    if (!newShift.staff || !newShift.day || !newShift.start || !newShift.end)
      return;

    setRoster([
      ...roster,
      {
        id: Date.now(),
        ...newShift
      }
    ]);

    setNewShift({ staff: "", day: "", start: "", end: "" });
  };

  const removeShift = id => {
    setRoster(roster.filter(r => r.id !== id));
  };

  return (
    <div className="card">
      <h3>Roster Management</h3>

      {/* Add Shift */}
      <div className="form-row">
        <select
          value={newShift.staff}
          onChange={e => setNewShift({ ...newShift, staff: e.target.value })}
        >
          <option value="">Select Staff</option>
          {STAFF.map(s => (
            <option key={s}>{s}</option>
          ))}
        </select>

        <select
          value={newShift.day}
          onChange={e => setNewShift({ ...newShift, day: e.target.value })}
        >
          <option value="">Day</option>
          {DAYS.map(d => (
            <option key={d}>{d}</option>
          ))}
        </select>

        <input
          type="time"
          value={newShift.start}
          onChange={e => setNewShift({ ...newShift, start: e.target.value })}
        />

        <input
          type="time"
          value={newShift.end}
          onChange={e => setNewShift({ ...newShift, end: e.target.value })}
        />

        <button className="btn-primary" onClick={addShift}>
          Add Shift
        </button>
      </div>

      {/* Roster Table */}
      <table className="table" style={{ marginTop: 20 }}>
        <thead>
          <tr>
            <th>Staff</th>
            <th>Day</th>
            <th>Start</th>
            <th>End</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {roster.map(r => (
            <tr key={r.id}>
              <td>{r.staff}</td>
              <td>{r.day}</td>
              <td>{r.start}</td>
              <td>{r.end}</td>
              <td>
                <button onClick={() => removeShift(r.id)}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
          {roster.length === 0 && (
            <tr>
              <td colSpan="5" align="center">
                No shifts added
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
